import { StyleSheet } from "react-native-web";

const styles = StyleSheet.create({
    container: {
        flex: 0.3,
        backgroundColor: '#fff',
        justifyContent: 'center',
        alignText: 'left'
    },
    switch: {
        flexDirection: 'row'
    }
})

export {styles}
